(233, 'Dokyuu Hentai HxEros', '', 'https://cdn.myanimelist.net/images/anime/1342/108321.jpg', 'Project No.9', 'Action,Comedy,Ecchi,School,Shounen,donghua', '2020-07-04', '2020', '2020summer', '', '23 min', 'completed', '', '', 'tv', 'Studio Mausu, Aniplex of America', '12', 'Lima tahun lalu makhluk asing yang dikenal sebagai Kiseichuu menginvasi dunia Dengan spesies yang terancam punah Kiseichuu bertekad untuk mengambil alih Bumi melalui rencana mematikan yang secara bertahap akan melenyapkan umat manusia singkirkan dorongan seksual manusia menggunakan berbagai metode membiarkan mereka mati Menanggapi skema Kiseichuus perangkat HxEros dikembangkan senjata ampuh yang hanya dapat digunakan oleh mereka yang memiliki energi erotis tingkat tinggi pada kapasitas maksimumnya Retto Enjou seorang siswa sekolah menengah yang menyimpan kebencian besar terhadap Kiseichuu bergabung dengan sekelompok pengguna HxEros untuk melawan mereka dan melindungi umat manusia Dengan perlengkapan mereka yang bergantung pada energi erotis sebagai sumber kekuatan tim harus bekerja sama untuk mempertahankan libido tingkat tinggi untuk memastikan kesiapan mereka untuk bertempur pada waktu tertentu Terlebih lagi karena dia tinggal di sebuah rumah yang penuh dengan gadis gadis yang penuh nafsu Enjou seharusnya tidak mengharapkan kekurangan kekuatan dalam waktu dekat ', '1', '2021-08-12 17:25:40'),
(234, 'Kyojinzoku no Hanayome', '', 'https://cdn.myanimelist.net/images/anime/1481/107629.jpg', 'Studio Hokiboshi', 'Fantasy,ShounenAi,Yaoi,Action', '2020-08-04', '2020', '2020summer', '', '6 min', 'ongoing', '', '', 'tv', ' ', '9', 'Kouichi Mizuki ends his high school basketball career on a high note, bringing his team to victory during their final match at nationals. Now free from club activities, he looks forward to spending more time socializing, maybe even finding room for romance. But fate has slightly different plans for him when a magical circle transports Kouichi to Tildant, the land of giants.  Upon his arrival, Kouichi comes face-to-face with Caius Lao Bistail, the titan king and the culprit behind his summoning. Caius is overjoyed, claiming Kouichi to be his fated bride and asking him to bear his children! It soon becomes evident to Kouichi that his species, let alone gender, is not a problem as Caius pushes him down onto a lavish bed. Will Kouichi ever find romance in this relationship that is bound to end in tears?', '1', '2021-08-13 18:50:37'),
(236, 'Megami-ryou no Ryoubo-kun', '', 'https://cdn.myanimelist.net/images/anime/1436/116410.jpg', 'asread.', 'Comedy,Ecchi,Harem,Romance,Shounen', '2021-07-14', '2021', '2021summer', ',,', '25 min', 'ongoing', 'hiatus', '', 'tv', ' Sentai Filmworks', '10', 'Kehidupan Koushi Nagumo yang berusia dua belas tahun tiba tiba menurun ketika ayahnya meninggalkannya setelah rumah mereka terbakar Dibiarkan berjuang sendiri Koushi ambruk di jalan tetapi seorang wanita eksentrik bernama Mineru Wachi mengasihani dia dan membawanya ke asrama wanita Megami ryou Setelah mengetahui situasi Koushi Mineru yang kebetulan menjadi manajer sementara mengundangnya untuk menjadi ibu asrama resmi Megami ryou Namun yang menantinya adalah penghuni asrama masing masing dengan kekejaman anehnya sendiri seperti Atena Saotome yang androfobia namun lembut tomboi feminin Kiriya Senshou dan Mineru sendiri yang kecerobohannya tidak mengenal batas dalam hal sains Meskipun demikian Koushi melakukan yang terbaik untuk memenuhi tugas kehidupan baru yang gila ini ', '1', '2021-09-16 16:54:04'),
(239, 'Accel World', 'Accelerated World', 'https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx11759-o3ZRpFYnP5Lc.jpg', 'Sunrise', 'Action,Game,Isekai,Romance,School,Sci-Fi,Shounen', '2012-04-07', '2012', '2012spring', '', '24 min', 'completed', '', '', 'tv', 'VIZMedia,Genco,Rakuonsha,Warner', '24', 'Haruyuki Arita adalah siswa sekolah menengah yang kelebihan berat badan dan diintimidasi yang menemukan pelipur lara dalam bermain game online Tapi hidupnya berubah drastis suatu hari ketika dia menemukan bahwa semua skor tingginya telah dikalahkan oleh Kuroyukihime wakil presiden OSIS yang populer Dia kemudian mengundang dia ke ruang siswa dan memperkenalkan dia ke Brain Burst sebuah program yang memungkinkan pengguna untuk mempercepat gelombang otak mereka ke titik di mana waktu tampaknya berhenti Brain Burst juga berfungsi sebagai game pertarungan augmented reality dan untuk mendapatkan lebih banyak poin untuk berakselerasi pengguna harus memenangkan duel melawan pemain lain Namun jika pengguna kehilangan semua poinnya mereka juga akan kehilangan akses ke Brain Burst selamanya Kuroyukihime menjelaskan bahwa dia memilih untuk menunjukkan Haruyuki program tersebut karena dia membutuhkan bantuannya Dia ingin bertemu pencipta Brain Burst dan mengungkap alasan mengapa itu dibuat tapi itu lebih mudah diucapkan daripada dilakukan untuk melakukannya dia harus mengalahkan Enam Raja Warna Murni pemimpin faksi yang kuat dalam permainan dan mencapai level 10 level tertinggi yang dapat dicapai Setelah gadis itu membantu Haruyuki mengatasi para pengganggu yang menyiksanya dia bersumpah untuk membantunya mewujudkan tujuannya dan mulailah perjuangan duo untuk mencapai puncak ', '1', '2021-08-22 23:01:05'),
(240, 'Accel World: InfiniteâˆžBurst', '', 'https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx21404-2jkb1Gidfb18.jpg', 'Sunrise', 'Action,Game,Sci-Fi,Romance,School', '2016-07-16', '2016', '2016summer', '', '1 jam. 22 menit', 'completed', '', '', 'movie', 'EggFirm,VIZMedia', '1', 'Pada tahun 2046 banyak aspek kehidupan dilakukan dalam jaringan virtual Tidak peduli seberapa maju waktu menjadi bagaimanapun bullying tidak pernah hilang Haruyuki adalah salah satu siswa yang di bully Namun suatu hari dia dihubungi oleh Kuroyukihime orang paling terkenal di sekolah Tidakkah kamu ingin mempercepat dan melangkah lebih jauh Nak Haruyuki diperkenalkan ke Dunia Accel dan memutuskan untuk bertarung sebagai ksatria Kuroyukihime', '1', '2021-08-23 22:58:21'),
(241, 'Kono Sekai no Katasumi', 'In This Corner of the World, To All the Corners of the World', 'https://cdn.myanimelist.net/images/anime/2/87704.jpg', 'MAPPA', 'Historical,Drama,Seinen', '2016-11-12', '2016', '2016fall', ',,', '2 jam. 48 menit', 'completed', '', '', 'movie', 'Shout!Factory,Genco,AnimatsuEnterta', '1', 'Suzu Urano adalah gadis yang murni dan baik hati yang suka menggambar dan menjaga kepalanya di awan Tumbuh di pinggiran Hiroshima bersama keluarganya dia dengan senang hati membantu bisnis nori neneknya Namun ketika dia dewasa Suzu meninggalkan rumah tercintanya untuk menikahi Shuusaku Houjou pria yang hampir tidak dia kenal Saat ia berintegrasi ke dalam rumah tangga suami barunya pengantin yang rindu rumah berjuang untuk menyesuaikan diri dengan lingkungan yang tidak dikenalnya saat upaya perang meluas jauh melampaui titik tidak bisa kembali Ketika perang mencapai halaman belakang Suzu sendiri dan kedamaian memberi jalan kepada kebrutalan bagaimana dia akan menghidupi dirinya sendiri dan orang orang yang dia cintai di sepanjang jalan Kono Sekai no Katasumi nimelukiskan penggambaran kehidupan sehari hari yang penuh warna namun menghantui di tahun tahun sebelum dan sesudah Perang Dunia II menampilkan ketekunan dan ketabahan orang Jepang biasa selama salah satu periode tergelap dalam sejarah modern ', '1', '2021-08-23 23:44:44'),
(242, 'Noblesse: Awakening', 'Noblesse Episode 0', 'https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx21629-1TAaEMqxkGC8.jpg', 'Production I.G', 'Action,Supernatural,Vampire,School', '2016-02-04', '2016', '2016winter', '', '31 min', 'completed', '', '', 'ona', ' ', '1', 'Dahulu kala hiduplah bangsawan ras kuno makhluk gaib abadi Mereka dipuja sebagai penguasa dan dewa Di antara para bangsawan adalah Noblesse seorang individu kuat yang diselimuti misteri bernama Cadis Etrama di Raizel atau Rai Setelah terbangun di Korea Selatan setelah tidur selama 820 tahun Rai bersiap untuk menemukan pelayannya yang setia dan berbakti Frankenstein yang dia temukan sebagai direktur Sekolah Menengah Ye Ran saat ini Dalam keinginannya untuk belajar lebih banyak tentang peradaban modern Rai mendaftar sebagai siswa untuk lebih merasakan kehidupan di dunia modern Noblesse Awakening merinci awal kehidupan baru Rai sebagai siswa sekolah menengah saat ia menghabiskan waktu bersama teman teman dan melawan ancaman baik manusia maupun supernatural untuk mencegah skema mereka merugikan Korea ', '1', '2021-08-24 00:06:31'),
(243, 'Koyomi History', 'Madogatari', 'https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx104434-6Pbe0XxAZp2S.png', 'Shaft', 'Comedy', '2016-09-22', '2016', '2016summer', '', '3 min.', 'completed', '', '', 'special', ' ', '1', 'Adaptasi cerita pendek Sejarah Koyomi dirilis di Blu ray Madogatari', '1', '2021-08-24 00:25:09'),
(244, 'Mob Psycho 100: Dai Ikkai Rei toka Soudansho Ian Ryokou - Kokoro Mitasu Iyashi no Tabi', 'Mob Psycho 100: The Spirits and Such Consultation Offices First Company Outing - A Healing Trip That Warms the Heart', 'https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx109819-71ZeBjJuU3da.png', 'Bones', 'Action,Comedy,SliceofLife,Supernatural', '2019-09-22', '2019', '2019summer', '', '24 min', 'completed', '', '', 'ova', 'WarnerBros.Japan,KlockWorx,BSFuji,H', '1', 'Staf Kantor Konsultasi Roh dan Semacam itu Arataka Reigen Shigeo Mob Kageyama Ritsu Kageyama Katsuya Serizawa dan roh Ekubo berangkat ke Prefektur Zebra untuk liburan mata air panas yang menenangkan Semua biaya perjalanan mereka disponsori oleh pemilik Pemandian Air Panas Ibogami yang telah meminta Reigen untuk menyelidiki klaim aktivitas paranormal di daerah tersebut Dalam perjalanan kereta ke penginapan Reigen dan Serizawa yang kelelahan dengan cepat tertidur hanya untuk bangun dan menemukan bahwa mereka telah dipindahkan ke dunia paralel hantu Bingung tentang bagaimana mereka sampai di sana Reigen dan Serizawa harus menemukan cara untuk melarikan diri tepat waktu untuk menikmati hari libur mereka ', '1', '2021-08-24 00:38:54'),
(245, 'Fate/Grand Order: First Order', 'Fate/Grand Order -First Order-', 'https://cdn.myanimelist.net/images/anime/6/82651.jpg', 'Lay-duce', 'Action,Supernatural,Magic,Fantasy', '2016-12-31', '2016', '2016fall', '', '1 hr. 14 min.', 'completed', '', '', 'movie', 'AniplexofAmerica,Aniplex,Notes', '1', 'Pada tahun 2015 Organisasi Keamanan Chaldea menarik para ahli dari bidang magis dan duniawi untuk mengamati masa depan umat manusia untuk kemungkinan peristiwa kepunahan Kelangsungan hidup umat manusia tampaknya terjamin untuk abad berikutnya sampai keputusan tiba tiba berubah dan sekarang pemberantasan spesies menunggu pada akhir 2016 Penyebabnya tidak diketahui tetapi tampaknya terkait dengan kota Fuyuki di Jepang dan peristiwa tahun 2004 selama Perang Cawan Suci Kelima Sebagai tanggapan Chaldea memanfaatkan sarana eksperimental perjalanan waktu teknologi Rayshift Dengan itu Ritsuka Fujimaru seorang pemuda yang baru direkrut ke organisasi dan gadis misterius Mash Kyrielight dapat melakukan perjalanan kembali ke tahun 2004 dan menemukan cara menyelamatkan umat manusia Perintah besar untuk melawan takdir telah diumumkan perintah untuk mengubah masa lalu dan memulihkan masa depan ', '1', '2021-08-24 00:49:18'),
(246, 'Yahari Ore no Seishun Love Comedy wa Machigatteiru. Zoku OVA', 'My Teen Romantic Comedy SNAFU OVA, Yahari Ore no Seishun Love Comedy wa Machigatteiru. Zoku: Kitto, Onnanoko wa Osatou to Spice to Suteki na Nanika de Dekiteiru', 'https://cdn.myanimelist.net/images/anime/13/84052.jpg', 'feel.', 'Comedy,Romance,School', '2016-10-27', '2016', '2016fall', '', '23 min.', 'completed', '', '', 'ova', '5pb.', '1', 'Setelah menerima undangan akhir pekan Hachiman Hikigaya menemani Isshiki Iroha di sekitar Prefektur Chiba untuk bertukar pikiran tentang ide yang cocok untuk kencan yang ideal dengan Hayato Hayama Saat keduanya mengembara dari satu tempat ke tempat lain tanpa rencana mereka tampaknya menikmati kebersamaan satu sama lain Namun melalui interaksi yang lugas dan tulus ini makna di balik apa artinya menjadi tulus terus menggugah minat Hachiman dan pandangannya tentang masa depan Klub Layanan Relawan dan para anggotanya ', '2', '2021-08-24 01:14:47'),
(247, 'Kono Subarashii Sekai ni Shukufuku wo!: Kono Subarashii Choker ni Shukufuku wo!', 'KonoSuba OVA, A Blessing to this Wonderful Choker!', 'https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx21574-CTRsdAGe4mDp.png', 'Studio Deen', 'Adventure,Comedy,Supernatural,Magic,Fantasy', '2016-06-24', '2016', '2016spring', '', '23 min', 'completed', '', '', 'ova', 'DiscotekMedia,HalfH.PStudio', '1', 'Saat menjelajahi toko sulap Wiz dengan partynya Kazuma Satou menemukan choker pengabul keinginan ajaib dan memutuskan untuk mencobanya Baru kemudian Wiz memberitahunya bahwa choker mencekik pemakainya sampai mati dalam empat hari kecuali keinginan mereka terpenuhi Ini tidak akan menjadi masalah jika Kazuma tahu apa keinginannya Khawatir akan kehidupan Kazuma Aqua Megumin dan Lalatina Darkness Dustiness Ford semua setuju untuk melakukan penawarannya untuk memuaskan keinginannya dan mudah mudahan mengabulkan keinginannya tidak peduli apa yang dia minta', '1', '2021-08-24 01:40:18'),
(248, 'Mob Psycho 100', 'Mob Psycho Hyaku, Mob Psycho One Hundred', 'https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/nx21507-UaVmcRIUjhUa.jpg', 'Bones', 'Action,SliceofLife,Comedy,Supernatural', '2016-07-11', '2016', '2016summer', '', '24 min', 'completed', '', '', 'tv', 'WarnerBros.Japan,KlockWorx,BSFuji,H', '12', 'Shigeo Mob Kageyama kelas delapan telah memanfaatkan sumber kekuatan batinnya di usia muda Tetapi kekuatan itu dengan cepat terbukti menjadi tanggung jawab ketika dia menyadari potensi bahaya dalam keterampilannya Memilih untuk menekan kekuatannya satu satunya penggunaan Mob saat ini untuk kemampuannya adalah untuk mengesankan naksir lamanya Tsubomi yang segera bosan dengan trik yang sama Untuk mengendalikan keterampilannya Mob mendaftarkan dirinya di bawah sayap Arataka Reigen seorang penipu yang mengaku sebagai paranormal yang mengeksploitasi kekuatan Mob untuk uang receh Sekarang mengusir roh jahat atas perintah telah menjadi bagian dari kehidupan sehari hari Mob yang monoton Namun energi psikis yang dia berikan hanyalah puncak gunung es jika potensinya yang besar dan emosinya yang tidak terkendali mengamuk peristiwa dahsyat yang akan membuatnya benar benar tidak dapat dikenali akan dipicu Perkembangan menuju ledakan Mob meningkat dan upaya untuk menghentikannya adalah sia sia ', '3', '2021-08-24 01:57:12'),
(249, 'Re:Zero kara Hajimeru Isekai Seikatsu', 'Re:ZERO -Starting Life in Another World,Re: Life in a different world from zero, Re:Zero, ReZero', 'https://cdn.myanimelist.net/images/anime/11/79410.jpg', 'White Fox', 'Psychological,Drama,Thriller,Fantasy', '2016-04-04', '2016', '2016spring', '', '25 min', 'completed', '', '', 'tv', 'TVTokyo,MediaFactory,KadokawaShoten', '25', 'Ketika Subaru Natsuki meninggalkan toko serba ada hal terakhir yang dia harapkan adalah terlepas dari kehidupan sehari harinya dan jatuh ke dunia fantasi Hal hal tidak terlihat baik bagi remaja yang kebingungan itu Namun tidak lama setelah kedatangannya dia diserang oleh beberapa preman Berbekal hanya sekantong belanjaan dan ponsel yang sekarang tidak berguna dia dengan cepat dipukuli hingga babak belur Untungnya kecantikan misterius bernama Satella yang sedang mengejar orang yang mencuri lencananya menimpa Subaru dan menyelamatkannya Untuk berterima kasih kepada gadis yang jujur dan baik hati Subaru menawarkan bantuan dalam pencariannya dan malam itu dia bahkan menemukan keberadaan apa yang dia cari Tapi tanpa sepengetahuan mereka kekuatan yang jauh lebih gelap mengintai pasangan itu dari bayang bayang dan hanya beberapa menit setelah menemukan lencana Subaru dan Satella dibunuh secara brutal Namun Subaru segera bangkit kembali ke pemandangan yang sudah dikenalnya dihadapkan oleh kelompok preman yang sama bertemu Satella lagi teka teki itu semakin dalam saat sejarah berulang secara tak dapat dijelaskan', '3', '2021-08-24 21:49:21'),
(250, 'Tensei shitara Slime Datta Ken 2nd Season Part 2', 'That Time I Got Reincarnated as a Slime Season 2 Part 2, Tensura 2', 'https://cdn.myanimelist.net/images/anime/1548/116226.jpg', '8bit', 'Action,Adventure,Comedy,Demons,Fantasy,Magic', '2021-07-06', '2021', '2021summer', 'oploverz,,,', '23 min', 'ongoing', 'hiatus', '', 'tv', 'Kodansha,BS11,BandaiNamcoArts,Micro', '12', 'Bangsa Tempest sedang dalam suasana meriah setelah berhasil mengatasi serangan mendadak dari Tentara Blumund dan Gereja Suci Barat Di luar perayaan terletak pertemuan antara Tempest dan sekutunya untuk memutuskan masa depan Bangsa Monster Akibat dari invasi Blumund perilaku mencurigakan Milim Nava dan hilangnya Demon Lord Carrion masalah tampaknya terus menumpuk Rimuru Tempest sekarang terbangun sebagai Raja Iblis Sejati memutuskan untuk menyerang Clayman Dengan Veldora Storm Dragon yang telah pulih sepenuhnya Raphael Ultimate Skill dan rekan rekan kuat lainnya penguasa Tempest percaya diri dalam mengalahkan musuh musuhnya satu per satu sampai dia dapat menghadapi pria yang menarik tali itu ', '4', '2021-09-22 01:02:15'),
(251, 'Jiutian Xuan Di Jue', 'The Success Of Empyrean Xuan Emperor', 'https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx133774-v7JB4m7rQkDg.png', 'Ruo Hong Culture', 'MartialArts,Action,Adventure,Demons,donghua,cgi', '2021-08-16', '2021', '2021summer', 'anichin,kazefuri,,,', '10 menit', 'ongoing', 'ongoing', '', 'ona', 'Youku', '40', 'Wang Fan yang memiliki Teknik Bela Diri Sembilan Surga Kaisar Xuan pada awalnya hanyalah murid dari Akademi Haung Jin Untuk membalaskan dendam kakaknya dia mengenakan topeng Raja Harimau Perak Sejak saat itu ada satu lagi Raja Harimau Perak yang mengancam dunia NamakuWang Fan raja raja Fan biasa Kenakan topengnya aku adalah Raja Harimau Perak Lepaskan topengnya saya adalah Wang Fan biasa Wang dari kata raja Sejati Fan dari kata biasa Jika melepaskan topeng aku hanyalah Wang Fan biasa', '1', '2021-09-29 00:00:06'),
(252, 'Nijiiro Days OVA', 'Rainbow Days OVA', 'https://cdn.myanimelist.net/images/anime/9/83487.jpg', 'Production Reed', 'Comedy,Romance,School,Shoujo,SliceofLife', '2016-09-23', '2016', '2016summer', '', '21 min', 'completed', '', '', 'ova', ' ', '1', 'Dibundel dengan volume edisi terbatas ke 13 dari manga saya akan memberikan ini 5 dari 10 maksud saya ova ini tidak termasuk cerita lanjutan dari serial TV itu hanya secara acak sepotong kutu momen lucu momen bahagia sesuatu seperti itu berarti tidak ada akhir yang terlibat tetapi untuk jenis telur ini cukup menyenangkan jika Anda sudah menonton serial tv maka Anda harus menonton ova ini juga tapi jangan berharap tentang endingnya itulah yang saya pikirkan oh dan juga lupa menyebutkan ova ini mudah dimengerti tidak ada garis keras atau kata kata itu berarti kita bisa bersenang senang menonton ova ini dengan bumbu yang lucu', '1', '2021-08-25 18:27:56'),
(253, 'Quanzhi Fashi Season 5', '', 'https://cdn.myanimelist.net/images/anime/1974/114887.jpg', 'Shanghai Foch Film Culture Investment', 'Action,Magic,Fantasy,School,donghua', '2021-07-28', '2021', '2021summer', 'anichin,kazefuri,,,', '20 menit', 'completed', '', '', 'ona', 'ChinaLiterature,TencentPenguinPictu', '12', 'Ular Mistik Pencakar Langit muncul di pusat kota dan Elang Putih menyerang kota secara besar besaran Tentu saja pasti ada sesuatu yang besar ketika Mo Fan muncul Apa Kota Song akan mengalami krisis setelah begitu tenang selama beberapa dekade bagaimanakah Mo Fan bisa menghadapinya', '2', '2021-09-01 21:25:40'),
