(259, 'Jue Shi Wu Hun', 'Peerless Martial Spirit, A Paragon of Wu hun, Jueshi Wuhun, Jue Shi Wu Shen', 'https://cdn.myanimelist.net/images/anime/1183/110438.jpg', 'Soyep', 'Action,MartialArts,Fantasy,donghua,cgi', '2020-10-25', '2020', '2020fall', 'anixlife,anichin,kazefuri,,,', '11 min', 'ongoing', '', '', 'ona', 'TencentPenguinPictures', '160', 'Di benua Longmai ribuan klan berdiri tegak sekte yang tak terhitung jumlahnya ada dan kultivasi adalah cara hidup Yang kuat dapat melakukan apa saja yang mereka inginkan sementara yang lemah hidup seperti semut Anak muda Chen Feng memiliki wilayah Dan yang tidak lengkap menyebabkan dia tidak dapat berkultivasi dia menahan ejekan yang tak terhitung jumlahnya yang diarahkan padanya Sampai dia mendapatkan garis keturunan naga misterius melepaskan kepompongnya dan membuka babak baru dalam hidupnya Roh rubah iblis centil kaisar wanita dingin gadis iblis atau putri dari klan bergengsi semuanya melompat ke pelukanku Dengan warisan yang tak tertandingi aku akan mewujudkan semangat bela diri terkuat mendapatkan semua keindahan dan melihat ke bawah dari surga ', '1', '2021-09-29 21:00:51'),
