(262, 'Night Head 2041', '', 'https://cdn.myanimelist.net/images/anime/1819/116662.jpg', 'Shirogumi', 'Drama,Mystery,Psychological,Sci-Fi,Supernatural', '2021-07-15', '2021', '2021summer', ',,', '22 min', 'completed', '', '', 'tv', 'FujiTV,SlowCurve,BSFuji,HakuhodoDYM', '12', 'Ini adalah anime Cyber punk seperti anime Akudama Drive Night Head 2041 saya menyukainya Masa depan yang tidak jauh dalam masyarakat empiris mungkin dikendalikan oleh sesuatu yang lebih besar yang menyangkal keberadaan itu dan yang tidak dapat dibuktikan br br Ini memiliki animasi CGI sangat indah dan divisualkan dengan baik saya berharap untuk terus menontonnya sepanjang musim ini Desain para Karakternya tidak diragukan lagi br Musik diimplementasikan dengan baik pada waktu yang tepat dan SFX sempurna Mari kita lihat bagaimana ceritanya berkembang apakah akan menjadi 2 vs 2 Hukum melawan apa yang tidak legal tetapi pada saat yang sama hukum memiliki apa yang tidak legal Secara umum jika orang menghargai anime ini akan menjadi karya seni musim ini meskipun sudah ada beberapa anime dengan gaya animasi ini menurut saya yang satu ini lebih menonjol br br Ceritanya mengikuti saudara saudara Kirihara yang sejak usia muda dipenjara di fasilitas ilmiah yang aman karena kekuatan gaib mereka setelah melarikan diri setelah penghalang yang mencegah mereka tidak berfungsi Ceritanya juga mengikuti saudara saudara Kuroki yang berusaha mengejar saudara saudara Kirihara ', '1', '2021-09-30 10:38:28'),
