(264, 'Shaman King (2021)', '', 'https://cdn.myanimelist.net/images/anime/1416/113270.jpg', 'Bridge', 'Action,Adventure,Comedy,SuperPower,Supernatural,Shounen', '2021-04-01', '2021', '2021spring', ',,', '23 min', 'ongoing', 'jumat', '', 'tv', 'TVTokyo,KingRecords,TechnoSound', '52', 'Dukun Shaman adalah individu luar biasa dengan kemampuan untuk berkomunikasi dengan hantu roh dan dewa yang tidak terlihat oleh orang biasa The Shaman Fight turnamen bergengsi yang mengadu domba dukun dari seluruh dunia melawan satu sama lain diadakan setiap lima ratus tahun di mana pemenangnya dinobatkan sebagai Shaman King Gelar ini memungkinkan pemegang jabatan saat ini untuk memanggil Roh Agung dan membentuk dunia sesuai keinginan mereka br br Menemukan dirinya terlambat untuk kelas pada suatu malam Manta Oyamada seorang siswa sekolah menengah biasa memutuskan untuk mengambil jalan pintas melalui pemakaman setempat Menyadari dia seorang anak laki laki yang duduk sendirian di atas batu nisan mengundang Manta untuk melihat bintang bersama mereka Menyadari bahwa mereka mengacu pada anak laki laki itu dan teman temannya yang hantu Manta melarikan diri dari teror Kemudian bocah itu memperkenalkan dirinya sebagai You Asakura seorang Shaman in training dan mendemonstrasikan kekuatannya dengan bekerja sama dengan hantu samurai berusia enam ratus tahun Amidamaru untuk menyelamatkan Manta dari sekelompok preman Anda berteman dengan Manta karena kemampuannya untuk melihat roh dan dengan bantuan Amidamaru mereka berangkat untuk mencapai tujuan Anda menjadi Raja Dukun berikutnya', '1', '2021-10-01 12:23:38'),
(265, 'Scarlet Nexus', '', 'https://cdn.myanimelist.net/images/anime/1314/116004.jpg', 'Sunrise', 'Action,Military,Sci-Fi,SuperPower', '2021-07-01', '2021', '2021summer', 'samehadaku,,,', '24 min', 'ongoing', 'jumat', '', 'tv', 'BandaiNamcoArts,Funimation', '', 'Kalender matahari tahun 2020 organisme aneh yang disebut Lainnya telah mulai memakan manusia Untuk mengalahkan musuh baru ini dibentuklah Other Suppression Force Diselamatkan oleh tim elit ini sebagai seorang anak psikokinetik Yuito bertahan dari pelatihan untuk mendaftar Di sisi lain keajaiban Kasane dibina karena kemampuannya Tapi mimpi Kasane menceritakan hal hal aneh padanya menyeret keduanya ke dalam nasib yang tak terhindarkan br br Jika Anda telah mengikuti Scarlet Nexus Anda tahu ini adalah game aksi penuh gaya yang menampilkan narasi ganda yang dibintangi oleh dua karakter Kemanusiaan telah menemukan bahwa beberapa anggotanya dilahirkan dengan kemampuan ekstra indera dikenal sebagai Psionics dan segera diserang oleh alien bermusuhan yang dikenal sebagai Other Terserah Kekuatan Penekan Lainnya kekuatan pertahanan yang dipenuhi Psionic untuk mengusir Yang Lain dan menyelamatkan dunia Pemain dapat mengontrol Kasane Randall seorang pengintai OSF yang memiliki kekuatan psikokinesis atau Yuito Sumeragi seorang rekrutan OSF yang pemberani Sebuah trailer baru yang berfokus pada Kasane secara khusus memberikan gambaran sekilas tentang kisahnya br br Scarlet Nexus akan hadir di PlayStation 5 Xbox Series X PlayStation 4 Xbox One dan PC Selain gim standar Bandai Namco juga memiliki beberapa edisi khusus gim br br Yang pertama adalah Edisi Deluxe Versi digital saja ini menggabungkan game dasar buku seni digital soundtrack game dan barang dalam game seperti set pakaian pertempuran khusus Merah item kosmetik Yang Lain dan Plug in SAS br br Jika itu tidak cukup untuk Anda mungkin Edisi Guardian lebih cocok untuk Anda Bocah nakal ini datang dengan semua barang digital dari Edisi Deluxe serta tiga Art Prints Hardcover Art Book OSF Sticker Steel book', '1', '2021-10-01 12:33:57'),
(266, 'Kuang Shen Mo Zun', 'Mad Demon Lord', 'https://cdn.myanimelist.net/images/anime/1084/114888.jpg', 'Soyep', 'Historical,Fantasy,cgi,donghua', '2021-05-20', '2021', '2021spring', 'anichin,kazefuri,,,', '10 Menit', 'ongoing', 'jumat', '', 'ona', 'TencentPenguinPictures', '60', 'Dia dengan enggan memilih Lin Xiao dan mengirimkan semua ingatannya Berikan Lin Xiao biarkan Lin Xiao sebagai pengamat dipaksa untuk mengalami pasang surut kehidupan kaisar alam dewa ini Di Benua Timur tempat tinggal Lin Xiao seni bela diri sedang menurun dan hanya ada sedikit pemurni keterampilan Dalam mimpinya Lin Xiao mengikuti Kaisar Langit Utara dan mempelajari serta mempraktikkan beberapa seni bela diri dan teknik penyempurnaan keterampilan yang pada dasarnya telah hilang br br Terutama di Negara Xia di Benua Timur di mana Lin Xiao berada semua orang terjebak dalam perebutan kekuasaan saling menghitung dan saling menganiaya Rumah Sifang Hou adalah yang pertama menanggung beban konspirasi Kota Xuanjing Ibu Lin Xiao Su Yiran dibunuh saat melahirkan Distosia menyebabkan Lin Xiao terlahir dengan akar dan tulang yang tidak sempurna Dia ditakdirkan untuk tidak memiliki prestasi dalam seni bela diri dan menjadi sasaran ejekan dan ejekan Meninggalkan tujuan pelatihannya sendiri dan bertindak acuh tak acuh Ketika Tuan Muda Wan bangun dari mimpi dan memegang kekuatan untuk membalikkan alam semesta dia secara alami akan membalas dendam dan jika tidak ada dendam dia akan menemukan lebih banyak masalah Lin Xiao yang kembali dari dunia mimpi ke dunia nyata secara bertahap menjadi mimpi buruk bagi seluruh Kota Xuanjing Lin Xiao bekerja selangkah demi selangkah dalam situasi yang bergejolak di ibu kota berperang melawan berbagai kekuatan yang tersembunyi dalam kegelapan dan melindungi Rumah Sifanghou dan seluruh Dinasti Daxia yang berada di tengah badai br br Dalam proses ini Lin Xiao menjauh dari identitas kaisar para dewa dan tuan muda Rumah Hou menyambut krisis dan terus menerus menemukan kebenaran yang terlupakan di dunia ini Untungnya Lin Xiao yang baik hati berkenalan dengan rekan yang benar benar luar biasa dan dapat dipercaya di masa masa sulit dan akhirnya berhasil menemukan dirinya sendiri Lin Xiao akhirnya menyelesaikan transformasi dari pengabaian pertama Xuanjing menjadi seorang pemimpin membuka jalan para dewa dan memimpin rekan rekannya untuk menyelamatkan benua ini dengan susah payah Pemuda ini akhirnya tumbuh menjadi seniman bela diri papan atas yang dihormati di dunia ini ', '1', '2021-09-25 20:31:56'),
