(269, 'Heion Sedai no Idaten-tachi', 'The Idaten Deities Know Only Peace', 'https://cdn.myanimelist.net/images/anime/1293/115173.jpg', 'MAPPA', 'Action,Adventure,Demons,Fantasy,Seinen', '2021-07-23', '2021', '2021summer', 'extonan,,,', '22 min', 'ongoing', 'jumat', '', 'tv', 'Aniplex,Dentsu,Hakusensha,FujiTV,GR', '11', 'Delapan ratus tahun yang lalu iblis yang menakutkan mengancam keberadaan umat manusia Di ambang kepunahan manusia berdoa kepada dewa dewa mereka memanggil seseorang untuk menyelamatkan mereka Muncul dari permohonan putus asa untuk keselamatan dewa pertempuran yang dikenal sebagai Idaten lahir Memiliki kekuatan dan daya tahan yang tidak wajar Idaten berhasil mengalahkan iblis dan era perdamaian yang belum pernah terjadi sebelumnya akhirnya diantarkan Karena belum pernah bertemu iblis sebelumnya generasi Idaten saat ini tidak tahu apa apa tentang kebrutalan iblis tetapi mereka hanya menjalani kehidupan yang damai Pelatihan di bawah Rin satu satunya Idaten yang tersisa dari 800 tahun yang lalu Idaten baru menemukan cara untuk bertahan hidup di masa di mana mereka tampaknya hidup lebih lama dari kegunaannya Namun ketika Kekaisaran Zoble yang kejam membangkitkan iblis dewa dewa yang tidak cocok dipanggil ke medan perang melawan musuh alami mereka sekali lagi ', '1', '2021-09-28 19:59:52'),
