(271, 'Higurashi no Naku Koro ni Sotsu', 'Higurashi: When They Cry â€“ SOTSU', 'https://cdn.myanimelist.net/images/anime/1083/115046.jpg', 'Passione', 'Dementia,Horror,Mystery,Psychological,Supernatural,Thriller', '2021-07-01', '2021', '2021summer', 'isekaisub,samehadaku,,,', '23 min', 'completed', '', '', 'tv', 'Funimation', '15', 'Rika Furude dan Satoko Houjou adalah teman baik yang telah tinggal di desa kecil Hinamizawa sepanjang hidup mereka Bersama teman teman mereka yang lain mereka menghabiskan setiap hari bersama dan setiap momen dipenuhi dengan kesenangan dan tawa Namun saat Rika dan Satoko mulai tumbuh dewasa kesempatan yang mengubah hidup muncul dengan sendirinya bagi mereka berdua Rika bertekad untuk mengikuti mimpinya dan menginginkan Satoko di sisinya Meskipun Satoko ragu ragu dia memutuskan untuk menempuh jalan ini bersama Rika Namun realisasi mimpinya membentuk keretakan di antara mereka Ini membuat gadis gadis itu hidup di dunia yang sama sekali berbeda dengan Rika menikmati kehidupan barunya dan mendapatkan teman baru sementara Satoko tumbuh semakin terisolasi Kerinduan untuk kembali ke hari hari nostalgia di Hinamizawa Satoko putus asa dan berharap segalanya bisa diubah Tepat ketika dia kehabisan akal pertemuan dengan entitas supernatural mengubah persepsi Satoko dan memberikan wahyu baru tentang sahabatnya Rika Ini memulai perjalanannya untuk mendapatkan masa depan yang diinginkannya dengan cara apa pun yang diperlukan ', '1', '2021-10-01 11:55:41'),
