(273, 'Xinghe Zhizun', 'Supreme Galaxy', 'https://cdn.myanimelist.net/images/anime/1266/115772.jpg', 'Ruo Hong Culture', 'Action,Historical,Fantasy,donghua,cgi', '2021-06-10', '2021', '2021spring', 'anichin,kazefuri,,,', '7 min', 'ongoing', 'sabtu', '', 'ona', ' ', '45', 'Sekte pertama dari Blue Earth Star sekte yang paling mempesona Sekte Bintang secara tidak sengaja memperoleh Peta Bintang harta karun dari sepuluh ribu alam yang menarik perhatian Penguasa Sepuluh Ribu Alam Anggota senior klan pergi ke Wilayah Bintang Suci dan memenjarakan mereka di Wilayah Bintang Suci Hanya satu tetua penjaga Zhuge Haohan dan tuan muda Chu Xinghe dan beberapa murid muda yang tersisa di Sekte Bintang Mereka ditekan oleh sekte lain karena kurangnya kekuatan dan dibawa pergi oleh Geng Elang Tuan muda Chu Untuk mendapatkan kembali kejayaannya Xinghe mencari ayahnya yang dipenjara dan anggota senior Sekte Bintang memimpin beberapa murid di bawah sektenya melalui dua belas alam bintang dan mengalahkan dua belas pusat kekuatan jiwa bintang di bawah Penguasa Sepuluh Ribu Alam Penguasa Sepuluh Ribu Alam menyelamatkan ayahnya dan semua bintang dari Sekte Bintang', '1', '2021-09-30 22:46:59'),
(274, 'Shaonian Ge Xing: Feng Hua Xue Yue Pian', 'Shao Nian Ge Xing 2nd Season, Shaonian Ge Xing 2nd Season, Great Journey of Teenagers 2nd Season', 'https://cdn.myanimelist.net/images/anime/1777/110315.jpg', 'CG Year', 'Action,Adventure,Mystery,Historical,MartialArts,cgi,donghua', '2021-07-28', '2021', '2021summer', 'anichin,kazefuri,,,', '17 menit', 'ongoing', 'sabtu', '', 'tv', 'bilibili', '32', 'Tidak takut akan kegagalan Setelah Xiao Se dan Lei Wujie datang ke Kota Xueyue Sikong Changfeng secara paksa menerima Xiao Se sebagai murid dan Lei Wujie bertemu dengan kakak beradik Li Hanyi Saat Xiao Se memasuki Kota Xueyue pangeran lainnya siap untuk bergerak dan mencari sekutu satu demi satu dan pertempuran antara para pangeran perlahan lahan terjadi di perjamuan pahlawan di Aula Leijia', '1', '2021-09-30 15:13:32'),
(275, 'Meikyuu Black Company', 'The Dungeon of Black Company', 'https://cdn.myanimelist.net/images/anime/1753/116290.jpg', 'SILVER LINK.', 'Comedy,Fantasy', '2021-07-09', '2021', '2021summer', 'anitoki,,,', '23 min', 'completed', '', '', 'tv', 'ToysFactory,JinnanStudio,Kadokawa', '12', 'Kinji yang tidak memiliki etika ketika dalam kerja apa pun ia adalah orang awam dalam kehidupan modernnya Suatu ketika dia menemukan dirinya dipindahkan ke dunia lain tetapi tidak dalam dunia fantasi besar yang biasa dimana seorang pahlawan yang disambut dengan tangan terbuka malah sebaliknya dan buruk dari itu Dia langsung didorong ke dalam pekerjaan yang mengerikan Sekarang diperbudak oleh perusahaan pertambangan jahat di dunia fantasi Kinji akan benar benar belajar arti kerja keras disini', '1', '2021-09-25 15:27:22'),
(276, 'Vanitas no Karte', 'The Case Study of Vanitas', 'https://cdn.myanimelist.net/images/anime/1811/115541.jpg', 'Bones', 'Fantasy,Historical,Shounen,Supernatural,Vampire', '2021-07-03', '2021', '2021summer', 'samehadaku,,,', '23 min', 'ongoing', 'sabtu', '', 'tv', 'Funimation,Aniplex,SquareEnix,Hakuh', '12', 'Pernah hidup seorang vampir yang dikenal sebagai Vanitas dibenci oleh jenisnya sendiri karena lahir di bawah bulan purnama biru karena kebanyakan muncul pada malam bulan merah Takut dan sendirian dia menciptakan Book of Vanitas sebuah buku sihir terkutuk yang suatu hari akan membalas dendam pada semua vampir begitulah setidaknya ceritanya Vanitas no Carte mengikuti No seorang pemuda yang bepergian dengan kapal udara di Paris abad ke 19 dengan satu tujuan menemukan Kitab Vanitas Serangan vampir yang tiba tiba membawanya untuk bertemu dengan Vanitas yang penuh teka teki seorang dokter yang berspesialisasi dalam vampir dan yang sangat mengejutkan No seorang manusia biasa Dokter misterius itu mewarisi nama dan teks terkenal dari legenda Vanitas menggunakan grimoire untuk menyembuhkan pasiennya Tapi di balik sikap baiknya ada sesuatu yang sedikit lebih jahat', '1', '2021-09-18 12:11:25'),
(277, '100-man no Inochi no Ue ni Ore wa Tatteiru 2nd Season', 'Im Standing on a Million Lives Season 2', 'https://cdn.myanimelist.net/images/anime/1083/117201.jpg', 'Maho Film', 'Action,Game,Drama,Fantasy,Shounen', '2021-07-10', '2021', '2021summer', 'doronime,,,', '23 menit', 'completed', '', '', 'tv', ' ', '12', 'disaat musim pertama dirilis aku tau kalian ketipu juga dengan poster gambar yang kesan nya dark mode serius banget itu dan berakhir kebalikannya yang telah melihat musim pertamanya bagi om om mungkin ini garing tapi bagi remaja ini seru entahlah maaf kenyataan memang seperti itu dan akhirnya kita bisa melihat aksi mereka lagi di musim keduanya ini', '1', '2021-09-25 15:44:27'),
(278, 'Otome Game no Hametsu Flag shika Nai Akuyaku Reijou ni Tensei shiteshimatta... X', 'My Next Life as a Villainess: All Routes Lead to Doom! X', 'https://cdn.myanimelist.net/images/anime/1088/116439.jpg', 'SILVER LINK.', 'Harem,Comedy,Drama,Romance,Fantasy,School,Shoujo', '2021-07-03', '2021', '2021summer', 'doronime,,,', '23 min', 'ongoing', 'sabtu', '', 'tv', 'Nichion', '12', 'musim kedua nya', '1', '2021-09-18 12:23:56'),
(279, 'Blue Reflection Ray', '', 'https://cdn.myanimelist.net/images/anime/1634/114551.jpg', 'J.C.Staff', 'Magic,School', '2021-04-10', '2021', '2021spring', 'okatsu,,,', '24 min', 'completed', '', '', 'tv', 'Funimation,MainichiBroadcastingSyst', '24', 'Ini adalah kisah tentang menghubungkan emosi yang bersinar Sukacita kesedihan kemarahan Perasaan adalah kekuatan tidak terlihat oleh mata yang dimiliki setiap orang Terkadang kekuatan ini bahkan mampu mengubah dunia Hiori Hirahara selalu memiliki sikap positif dan tidak bisa membiarkan orang dalam kesulitan sendirian Ruki Hanari canggung secara sosial dia ingin bergaul dengan baik dengan orang lain tapi dia tidak tahu bagaimana melakukannya Bagaimana pertemuan kedua gadis yang sangat berbeda ini tidak hanya mengubah mereka tetapi juga dunia itu sendiri', '1', '2021-09-25 15:09:17'),
(280, 'Kanojo mo Kanojo', 'Girlfriend, Girlfriend', 'https://cdn.myanimelist.net/images/anime/1713/117119.jpg', 'Tezuka Productions', 'Harem,Comedy,Romance,School,Shounen', '2021-07-03', '2021', '2021summer', ',,', '24 min', 'ongoing', 'sabtu', '', 'tv', 'HalfH.PStudio,NBCUniversalEntertain', '12', 'Setelah memendam cinta yang tak terbalas selama bertahun tahun Naoya Mukai akhirnya berkencan dengan teman masa kecilnya Saki Saki Namun saat dia mencoba berkomitmen pada hubungan ini dia menerima pengakuan tiba tiba dari Nagisa Minase br br Pada awalnya Naoya mencoba untuk menolaknya tetapi segera diatasi oleh perasaan tidak ingin menyakiti Nagisa Mencoba untuk menghindari mengkhianati kepercayaan pacarnya padanya Naoya memikirkan solusi untuk membuat kedua gadis itu bahagia dua kali Secara alami Saki menolak ide ini tetapi melalui kegigihan Naoya dan Nagisa dia dengan enggan menyerah br br Dengan ini perselingkuhan tiga arah dimulai antara Naoya pacarnya dan pacar lainnya saat mereka mengembangkan hubungan yang menyimpang dari norma sosial', '1', '2021-09-18 14:54:51'),
(281, 'Chunqiu Feng Shen', 'God of Spring and Autumn, Chun Qiu Feng Shen, Chun Qiu Zhi Shen, Chunqiu Zhi Shen', 'https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx131009-QeowXU7g3Jzp.png', 'Youliao Studio', 'Fantasy,cgi,donghua,Adventure', '2021-07-08', '2021', '2021summer', 'kazefuri,,,', '17 mins', 'ongoing', 'sabtu', '', 'ona', 'iQIYI,ShanghaiLingxiCultureTechnolo', '24', 'Pada tahun terakhir benua iblis berada dalam masa masa sulit Gadis misterius Shang berkeliling dengan kekuatan darah orang bijak kuno untuk menstabilkan dunia tetapi berulang kali jatuh ke dalam kesulitan Untungnya sedikit kasih sayang mengikat Han Ji muda dengan nasib tragisnya Pemuda itu mengorbankan hidupnya untuk melindungi satu sama lain dan memulai perjalanan untuk menemukan Taiyu Jiuding bersamanya dan mementaskan dongeng yang menyentuh', '1', '2021-10-01 11:40:41');
