(282, 'Mo Dao Zu Shi: Wanjie Pian', 'Mo Dao Zu Shi Season 3', 'https://cdn.myanimelist.net/images/anime/1634/116782.jpg', 'B.CMAY PICTURES', 'Action,Historical,Demons,Supernatural,Drama,Magic', '2021-08-07', '2021', '2021summer', 'anixlife,,,', '24 menit', 'ongoing', 'sabtu', '', 'ona', 'TencentPenguinPictures', '', 'Musim ketiga dan terakhir Mo Dao Zu Shi yang mencakup Arc Kota Yi Ceritanya mengikuti dua karakter utama Wei Wuxian dan Lan Wangji saat mereka mencoba menyelesaikan misteri di balik lengan berhantu dari mayat yang tidak dikenal', '1', '2021-09-26 00:45:12'),
(283, 'Dragon Quest: Dai no Daibouken 2020', 'Dragon Quest: The Adventure of Dai', 'https://cdn.myanimelist.net/images/anime/1499/109126.jpg', 'Toei Animation', 'Action,Adventure,Fantasy,Shounen', '2020-10-03', '2020', '2020fall', 'aksensei,gblovers,,,', '24 min', 'ongoing', 'ahad', '', 'tv', 'TVTokyo,SquareEnix,Shueisha', '', 'Dahulu kala ada pendekar pedang yang gagah berani yang kemudian dikenal hanya sebagai pahlawan Ada iblis yang menyebabkan orang menderita Pahlawan dan teman temannya tiba untuk menantang iblis ke pertempuran dan dengan menggabungkan kekuatan mereka pertempuran itu berakhir dengan cepat Dengan tidak ada orang di sekitar yang menimbulkan masalah pulau itu menjadi tempat yang tenang di mana semua orang bisa hidup bersama dalam damai br br Beberapa tahun kemudian iblis itu dihidupkan kembali Protagonis kita saat ini Dai tinggal di pulau terpencil di laut selatan dan bercita cita menjadi pahlawan besar Ketika dia mendengar tentang kebangkitan iblis Dai dan teman temannya mengambil tanggung jawab sendiri untuk menghentikannya dan kekuatan jahat yang menghidupkannya kembali Sepanjang jalan Dai menemukan identitas pahlawan kebenaran di balik kekuatan jahat yang menghidupkan kembali iblis dan kekuatan tersembunyi Dai sendiri yang muncul pada saat saat bahaya', '1', '2021-09-25 16:06:29'),
(284, 'Boku no Hero Academia 5th Season', 'Boku no Hero Academia season 5, My Hero Academia Season 5', 'https://cdn.myanimelist.net/images/anime/1911/113611.jpg', 'Bones', 'Action,Comedy,SuperPower,School,Shounen', '2021-03-27', '2021', '2021spring', 'oploverz,,,', '23 min', 'completed', '', '', 'tv', 'Dentsu,Movic,YTV,SonyMusicEntertain', '25', 'Kami merekomendasikan untuk mendownload anime langsung difansub nya', '4', '2021-09-25 19:48:36'),
(285, 'Wan Jie Du Zun', '', 'https://cdn.myanimelist.net/images/anime/1571/114240.jpg', 'Ruo Hong Culture', 'Action,Fantasy,Historical,MartialArts,Donghua,cgi', '2021-04-06', '2021', '2021spring', 'anichin,kazefuri,,,', '10 min', 'ongoing', 'ahad', '', 'ona', ' ', '50', 'Seorang Pemuda yang kehilangan jiwa bela dirinya secara tragis kemudian terlahir kembali di Nirvana dan mengubah nasibnya melawan langit br br b Spoiler b br Lin Feng Dia baru saja mengembangkan jiwa bela diri pedang ke dalam bentuk yang belum sempurna Tunangannya Ji Manyao mengambil kesempatan untuk mengambil jiwa bela dirinya dan dia hampir muntah darah dan mati Pada saat yang sama roh Lin Feng memasuki tanah pemakaman para dewa Wanita misterius di tanah pemakaman memberi tahu Lin Feng bahwa dia bisa mendapatkan kekuatan dan pengetahuan seni bela diri yang sangat besar dengan menghancurkan dewa dewa kuno yang dimakamkan di sini Di dunia nyata Lin Feng yang pada awalnya adalah tuan muda dari keluarga Lin tidak lagi dihormati oleh para pelayan karena kehilangan pedang dan semangat bela dirinya Mereka mengincar Lin Feng di mana mana Bahkan jika saudara perempuan Lin Feng Lin Xiang eh sakit mereka tidak mau membantu Tidak sampai Lin Feng menggunakan kekuatan yang dia peroleh dari tempat dewa pemakaman untuk mengalahkan pembangkit tenaga seni bela diri Huangjie Lin Yuhong orang orang dari keluarga Lin mengubah sikap mereka terhadap Lin Feng Di sisi lain Lin Feng tidak begitu sehat ', '1', '2021-09-18 23:18:24'),
(286, 'Bokutachi no Remake', 'Remake our Life!', 'https://cdn.myanimelist.net/images/anime/1737/112772.jpg', 'feel.', 'SliceofLife,Drama,Romance', '2021-07-03', '2021', '2021summer', 'doronime,,,', '25 min', 'ongoing', 'ahad', '', 'tv', 'StudioMausu,bilibili,BushiroadMusic', '12', 'Hashiba Kyouya adalah seorang pengembang game berusia 28 tahun Dengan perusahaannya bangkrut dan dia kehilangan pekerjaannya dia kembali ke kampung halamannya Melihat kesuksesan pencipta seusianya dia mendapati dirinya menyesali keputusan hidupnya saat dia berbaring tertekan di tempat tidurnya Saat Kyouya bangun dia menemukan bahwa dia telah melakukan perjalanan sepuluh tahun ke masa sebelum dia masuk perguruan tinggi Akankah dia akhirnya bisa memperbaiki keadaan Ini adalah kisah tentang orang gagal yang diberi kesempatan kedua untuk mengejar mimpinya', '1', '2021-09-26 02:32:31'),
(287, 'Mahouka Koukou no Yuutousei', 'The Honor at Magic High School', 'https://cdn.myanimelist.net/images/anime/1719/116262.jpg', 'Connect', 'Fantasy,Magic,Sci-Fi', '2021-07-03', '2021', '2021summer', 'samehadaku,,,', '23 min', 'ongoing', 'ahad', '', 'tv', 'Aniplex', '13', 'Satu abad telah berlalu sejak sihir sihir sejati benda benda legenda telah kembali ke dunia Ini adalah musim semi musim awal yang baru dan kelas siswa baru akan memulai studi mereka di Sekolah Menengah Afiliasi Universitas Sihir Nasional Pertama nama panggilan SMA Pertama br br Sebuah manga spin off dari seri novel ringan yang sangat populer Mahouka Koukou no Rettousei The Irregular at Magic High School Mahouka Koukou no Yuutousei The Honor Student at Magic High School mengikuti peristiwa dari seri aslinya seperti yang terlihat melalui mata dari Miyuki Shiba saudara perempuan Tatsuya Kehidupan seorang siswa teladan datang dengan banyak harapan dan perasaan tersembunyi yang tak terduga ', '1', '2021-09-26 04:27:38'),
(288, 'Magia Record: Mahou Shoujo Madokaâ˜†Magica Gaiden (TV) 2nd Season - Kakusei Zenya', 'Magia Record: Puella Magi Madoka Magica Side Story Season 2 - The Eve of Awakening', 'https://cdn.myanimelist.net/images/anime/1919/116424.jpg', 'Shaft', 'Psychological,Drama,Magic,Thriller', '2021-08-01', '2021', '2021summer', 'samehadaku,,,', '23 min', 'ongoing', 'ahad', '', 'tv', 'AniplexofAmerica', '8', 'Saya menulis tentang episode pertama Ini sangat mengejutkan Madoka kembali Saya tidak tahu apa apa tentang penampilan madoka di cerita sampingan ini Episode ini seharusnya ditayangkan di musim pertama Mengapa tidak Episode ini menghubungkan dunia Madoka dengan rekor magia Episode ini sangat bagus menyalakan harapan bahwa musim ini akan baik Tampaknya musim ini akan menutupi semua kekurangan yang ada di musim 1 Pecinta Madoka yang kecewa dengan magia record harus memberikan musim ini kesempatan Anda mungkin menyukai musim ini ya Anda akan melihat madoka di musim 2 ini Anda mungkin merasa lebih puas dengan akhir daripada aslinya Saya telah memainkan permainan jadi saya tahu keseluruhan cerita Episode ini menunjukkan bagaimana catatan magia terhubung ke aslinya', '1', '2021-09-26 03:52:30'),
(289, 'Kageki Shoujo', 'Opera Girl', 'https://cdn.myanimelist.net/images/anime/1944/114427.jpg', 'Pine Jam', 'Drama,School,Shoujo', '2021-07-04', '2021', '2021summer', 'okatsu,,,', '24 min', 'ongoing', 'ahad', '', 'tv', 'Hakusensha,KingRecords,Funimation', '13', 'Didirikan di era Taisho Perusahaan Opera Bunga Merah menarik hati orang orang dari generasi ke generasi di panggung yang indah dan indah yang dibuat hanya oleh wanita yang belum menikah Siswa generasi ke 100 yang telah melewati perbesaran tinggi dan memasuki Sekolah Musik Opera Bunga Merah untuk mengembangkan sumber daya manusia Sarasa Watanabe gadis lugu dengan tinggi 178 cm yang mendambakan Oscar sama Ai Narada mantan idola nasional yang cuek terhadap segala hal baik mimpi maupun teman Kehidupan sekolah musik yang penuh dengan harapan dan konflik di mana semuanya terputus putus akan segera dimulai', '1', '2021-09-26 03:36:01'),
(290, 'Jahy-sama wa Kujikenai', 'Jahy-sama Wont Be Discouraged!, The Great Jahy Will Not Be Defeated!', 'https://cdn.myanimelist.net/images/anime/1154/115599.jpg', 'SILVER LINK.', 'Comedy,Supernatural,Shounen', '2021-08-01', '2021', '2021summer', 'samehadaku,,,', '23 min', 'ongoing', 'ahad', '', 'tv', 'SquareEnix,ABCAnimation', '20', 'Anime ini terasa sangat hambar dan generik Secara pribadi itu mengingatkan saya pada Hataraku Maou sama tetapi encer dan generik Anime ini terasa seperti itu tapi membuatnya kurang lucu kurang pengembangan dan kurang karakter Yang menarik semua orang di Hataraku Maou sama adalah ide gila untuk membalik isekai anime ini bukanlah ide baru sekarang dan gagal untuk memperbaikinya Saya agak keras setelah satu episode dan tidak ada pengalaman manga dengannya Namun anime lain memberikan hook and build yang kuat di episode pertama dan saya tidak merasakannya di sini Siapa tahu itu mungkin membaik tetapi kurang menyenangkan yang dibutuhkan anime komedi terus terang itu membosankan br br Setelah dihormati sebagai otoritas terbesar kedua di Alam Iblis ajudan Raja Iblis Jahy memerintah rakyatnya dengan ketakutan Tetapi ketika seorang gadis penyihir menyerang dan menghancurkan permata mistik yang mengandung kekuatan besar Alam Iblis dihancurkan br br Meskipun dia selamat Jahy telah kehilangan hampir semua kekuatannya dan menemukan dirinya terdampar di dunia manusia dengan penampilan seperti anak kecil Untuk mengumpulkan lebih banyak permata mistik sehingga dia dapat secara permanen memulihkan bentuk aslinya dan Alam Iblis Jahy harus menyesuaikan diri dengan kehidupan barunya dan menghadapi masalah sehari hari yang belum pernah dia alami sebelumnya Dari bekerja untuk membayar biaya hidup hingga berdebat dengan pemiliknya setiap kali sewanya terlambat Jahy yang agung tidak akan berkecil hati', '1', '2021-09-19 17:38:27'),
(291, 'Re-Main', '', 'https://cdn.myanimelist.net/images/anime/1838/114857.jpg', 'MAPPA', 'Sports,School', '2021-07-04', '2021', '2021summer', 'huntersekai,,,', '23 min', 'ongoing', 'ahad', '', 'tv', 'Funimation,BandaiNamcoArts', '12', 'harusnya ini salah satu judul yang trending di musim ini tapi entahlah mappa emang beda Cerita berpusat pada Minato Kiyoumizu seorang anak laki laki yang berhenti bermain polo air setelah insiden selama musim dingin tahun ketiga sekolah menengah pertama Setelah masuk SMA dia membuat janji dan memutuskan untuk mencoba polo air lagi dan bergabung dengan tim sekolah bersama teman temannya Namun tim baru akan mengalami masalah di sepanjang jalan', '1', '2021-09-19 04:43:43'),
