(305, 'Tantei wa Mou Shindeiru', 'The Detective Is Already Dead', 'https://cdn.myanimelist.net/images/anime/1843/115815.jpg', 'ENGI', 'Comedy,Drama,Mystery,Romance', '2021-07-04', '2021', '2021summer', 'huntersekai,,,', '25 min', 'ongoing', 'ongoing', '', 'tv', 'AT-X,KadokawaMediaHouse,Kadokawa,IN', '12', 'Kimizuka Kimihiko adalah magnet krisis Dari terjebak di TKP hingga secara tidak sengaja menyaksikan transaksi narkoba masalah tampaknya menemukannya di setiap sudut Jadi tidak mengherankan ketika penerbangannya yang agak biasa tiba tiba memasuki keadaan darurat dengan sangat membutuhkan seorang detektif di dalamnya Sayangnya usahanya untuk menghindari masalah digagalkan oleh seorang gadis cantik berambut perak yang menggunakan nama sandi Siesta Menyatakan dirinya seorang detektif dia tanpa basa basi menyeret Kimizuka ke dalam kasing sebagai asistennya br br Kejadian itu menandai awal dari petualangan keliling dunia yang melampaui imajinasi terliarnya Mempertaruhkan nyawa mereka keduanya menjatuhkan organisasi kriminal mencegah bencana dan menyelamatkan ribuan orang Tapi tirai menutup perjalanan epik mereka dengan kematian dini Siesta tiga tahun kemudian br br Memutuskan untuk menjalani kehidupan sekolah menengah biasa kali ini Kimizuka menghabiskan satu tahun mempertahankan profil rendah Namun seperti sudah ditakdirkan seorang gadis dengan kemiripan yang luar biasa dengan Siesta datang menerjang ke dalam hidupnya mengancam akan membuat hari harinya yang damai menjadi kacau', '1', '2021-09-20 00:35:51'),
(306, 'Shinigami Bocchan to Kuro Maid', 'The Duke of Death and His Maid', 'https://cdn.myanimelist.net/images/anime/1471/115593.jpg', 'J.C.Staff', 'Comedy,Drama,Romance,Supernatural', '2021-07-04', '2021', '2021summer', 'huntersekai,,,', '24 min', 'ongoing', 'ongoing', '', 'tv', 'NBCUniversalEntertainmentJapan,Funi', '12', 'Setelah melihat eps 1 nya ingin ku berteriak Buang buang alur cerita yang indah jika CGI yang sama sampai akhir br br Sinopsisnya Dikutuk oleh penyihir sebagai seorang anak seorang adipati muda memperoleh kekuatan yang tidak diinginkan untuk membunuh setiap makhluk hidup yang disentuhnya Dipaksa untuk pindah dari keluarganya dan ke sebuah rumah besar jauh di dalam hutan sang duke diperlakukan seolah olah dia tidak ada dan terus dijauhi oleh teman temannya br br Namun dia tidak sepenuhnya sendirian Rob dan Alice kepala pelayan dan pelayannya selalu berada di sisinya Alice suka menggodanya dan saat hubungan mereka tumbuh sang duke membuat tujuannya untuk membebaskan diri dari kutukan mautnya Tentu saja dia akan membutuhkan bantuan dan siapa yang lebih baik melakukan ini selain berbagai penghuni supranatural', '1', '2021-09-13 00:30:25'),
(307, 'Kingdom 3rd Season', 'Kingdom Season 3', 'https://cdn.myanimelist.net/images/anime/1443/111830.jpg', 'Pierrot Plus', 'Action,Military,Historical,Seinen', '2020-04-06', '2020', '2020spring', 'samehadaku,,,', '25 min', 'ongoing', 'ongoing', '', 'tv', 'StudioSignpost,Funimation,NHK,Shuei', '26', 'Kingdom Is OP Dari plot hingga aksi ini adalah anime yang membuat darah Anda terpompa dan siap beraksi Saya 100 merekomendasikan ini kepada semua orang br br Jika Anda belum mulai menontonnya beruntunglah anda kami telah menunggu selama 6 tahun untuk musim ke 3 nya br br Anda dapat melanjutkan manga yang kedua mulai dari volume 17 bab 174 hingga volume 24 chapter 260 meskipun saya pribadi belum membaca manga apa pun hanya karena saya menunggu anime saya penasaran tetapi keinginan saya kuat br br Satu satunya downside yang saya lihat orang orang miliki adalah grafik tetapi ini hanya masalah yang sangat kecil bagi saya karena saya pikir itu baik baik saja sangat sangat sulit untuk menemukan anime BAIK dengan kualitas seperti itu br br Yang saya miliki hanyalah pujian untuk Anime ini br br ini anime baddas terbaik yang sangat memacu ardernalin saya cerita berlanjut Setelah kampanye Sanyou yang sukses tentara Qin termasuk 1 000 orang Komandan Li Xin semakin dekat untuk memenuhi impian Raja Ying Zheng untuk menyatukan Tiongkok Dengan pijakan geografis utama di negara bagian Wei yang sekarang berada di bawah kendalinya Qin mengarahkan pandangannya ke timur menuju negara negara bagian yang berperang br Sementara itu Li Mu seorang ahli strategi yang tak tertandingi dan perdana menteri negara bagian Zhao yang baru diangkat telah memanfaatkan gencatan senjata sementara Zhao dengan Qin untuk bernegosiasi dengan negara negara lain tanpa gangguan Tanpa peringatan Ying Zheng menerima berita bahwa tentara dari negara bagian Chu Zhao Wei Han Yan dan Qi telah menyeberang ke wilayah Qin Sadar terlambat untuk tujuan di balik gencatan senjata Li Mu dengan Qin Zheng dengan cepat mengumpulkan penasihatnya untuk menyusun rencana untuk menangani pasukan koalisi enam negara di depan pintu mereka Untuk pertama kalinya dalam sejarah negara bagian Qin menghadapi kehancuran total dan harus menggunakan setiap sumber daya dan strategi yang mereka miliki untuk mencegah diri mereka terhapus dari peta ', '1', '2021-09-27 12:30:23'),
