(310, 'Juan Siliang', 'The Island of Siliang', 'https://cdn.myanimelist.net/images/anime/1745/116295.jpg', 'Wulifang Digital', 'Action,Fantasy,Donghua,cgi', '2021-06-14', '2021', '2021spring', 'anichin,kazefuri,,,', '20 menit', 'ongoing', '', '', 'ona', 'YearYoungCulture,TencentPenguinPict', '15', 'sebuah pulau abadi di dunia asing menafsirkan perasaan indah antara orang orang dan proses pertumbuhan anak muda Dengan gaya lukisan yang indah pemodelan karakter yang indah br br Dimulai dari kisah hilangnya orang tua protagonis Jingxuan Come to Thoughts selangkah demi selangkah mengungkap rahasia masa lalu di pulau Pikiran Pada saat yang sama ia menceritakan kisah sekelompok anak muda yang bekerja keras untuk berubah dan melepaskan diri dari belenggu untuk tujuan hidup mereka Hubungan antara Jingxuan keturunan para dewa yang dingin di luar dan panas di dalam makhluk fana rumah teknis heroik Liniang para dewa dan binatang buas kuno yang misterius tidur dan keluarga Xujia dan Chengjia di Pulau Siliang rumit Selain itu setiap adegan dalam animasi penuh dengan konotasi oriental dan gaya Cina baru yang indah dan tidak konvensional Bentuk karakter yang khas dan efek visual yang dibuat dengan cermat juga membuat film ini lebih unik dan indah', '1', '2021-09-08 23:01:32'),
(311, 'Ni Tian Zhizun', 'Against The Sky Supreme,N.T.Z.Z', 'https://cdn.myanimelist.net/images/anime/1557/117031.jpg', 'Soyep', 'Action,MartialArts,Fantasy,donghua,cgi', '2021-07-16', '2021', '2021summer', 'anichin,kazefuri,,,', '10 min', 'ongoing', '', '', 'ona', 'TencentPenguinPictures', '60', 'Seluruh alam semesta dibagi menjadi alam semesta bagian dalam dan alam semesta luar Kedua alam semesta merupakan musuh satu sama lain Alam semesta luar diperintah oleh iblis dan alam semesta bagian dalam dibagi menjadi Alam dewa Alam Abadi dan Alam Fana Di alam semesta ada dunia fana yang tak terhitung jumlahnya seperti Benua Tianfa dan mereka secara kolektif disebut sebagai Wilayah Jiutian Xin Di bidang Jiutian Xin sembilan kaisar abadi memerintahkan semua bidang bintang di sembilan lapisan br br Di atas sembilan surga adalah ranah pemurnian para dewa abadi Cara bagi yang Abadi untuk berubah menjadi dewa harus melalui pemurnian para dewa untuk memadatkan ketuhanan dan menjadi dewa Ada ribuan suku di Alam Dewa dan para dewa dari semua suku sangat kuat Di masa lalu yang jauh puluhan ribu ras di Alam Dewa diperintah oleh Siyuan Supreme Hundun Supreme dan Hongmeng Supreme Tiga makhluk tertinggi berdiri di atas satu sama lain mengatur ranah para dewa dan ranah Sembilan Surga Penguasa Alam Dewa Hongmeng Hongmeng Supreme memiliki status bangsawan memiliki banyak bawahan dan merupakan orang terkuat di Alam Dewa yang mahir dalam semua jenis jurus di dunia br br Pada saat itu Hongmeng Supreme kuat tetapi dia memperlakukan orang dengan baik baik dan murah hati mempercayai teman temannya dan memperlakukan tiga alam fana abadi dan dewa dengan sikap yang sama Selama invasi alam semesta ekstrateritorial Hongmeng Supreme bersama sama dibunuh oleh Hundun Supreme dan Siyuan Supreme dan mengutuk reinkarnasinya Kerabat Hongmeng Supreme terbunuh rumah mereka disita dan ide mereka diubah bahkan Dewa Tuer Lingxiayang paling dicintai pun mengkhianatinya Selain itu dia dihancurkan dari generasi ke generasi dalam reinkarnasinya sampai dia bereinkarnasi di tubuh Tan Yun di kehidupan terakhirnya Tan Yun adalah tuan muda dari keluarga Tan bangsawan kecil di Kota Wangyue tetapi Hongmeng Supreme yang bereinkarnasi perlu dirangsang oleh hidup dan mati untuk bangkit br br more Jjadi Tan Yun telah diintimidasi dan dihina selama enam belas tahun pertama Selama pernikahan Tan Yun bertemu dengan tuan muda Situ dan tunanganya dia dipukuli hampir mati akhirnya membangkitkan ingatan Hongmeng Supreme Tan Yun yang biasa saja mengandalkan janin ilahi Hongmeng untuk mengubah nasibnya melawan surga dan memiliki bakat tingkat dewa Tan Yun pertama tama membalaskan dendam keluarganya dan kemudian memasuki Huangfu Shengzong br br Sejak saat itu dia mengandalkan kebijaksanaan dan keterampilan Hongmeng Supreme untuk membuat kemajuan di Huangfu Shengzong menjadi penguasa sepanjang jalan dan akhirnya menyatukan Benua Tianfa Selama periode ini dia bertemu dengan bawahannya yang bereinkarnasi dan istrinya menemukan artefak yang dia gunakan ketika dia menjadi yang tertinggi belajar tentang peristiwa peristiwa besar dalam para dewa dan juga memanen banyak keindahan yang luar biasa ', '1', '2021-09-27 22:08:43'),
(312, 'Dinghai Fusheng Lu', 'Dinghai Fusheng Records', 'https://cdn.myanimelist.net/images/anime/1943/115892.jpg', 'Shanghai Foch Film and TV Culture Investment', 'Action,Historical,Fantasy,donghua,cgi', '2021-07-15', '2021', '2021summer', 'anichin,kazefuri,', 'Bilibili', 'ongoing', 'complete', '', 'ona', 'Bilibili', '12', 'Berabad abad yang lalu tanah Cina penuh dengan roh magis Mereka yang bisa memanfaatkan kekuatan roh disebut Exorcist Tugas mereka adalah mencegah Diablo Hebat iblis yang muncul sekali setiap milenium mengganggu dunia Namun di Dinasti Han dalam bencana yang dikenal sebagai The Oblivion semua roh magis lenyap dalam semalam Setelah kehilangan kekuatan mereka Exorcist menjadi sesuatu dari masa lalu br br Kemudian selama perang yang tak henti hentinya antara Kerajaan Qin dan Jin roh kebencian dari mereka yang mati sia sia menjadi nutrisi yang memicu kebangkitan Diablo Besar Untuk menghentikan iblis Chen Xing Exorcist terakhir yang masih hidup memulai perjalanan dengan Lamp of the Heart artefak magis yang hidup di jiwanya Dia akan melakukan perjalanan ke Kota Xiangyang untuk menemukan Xiangshu yang ditakdirkan untuk bergabung dengannya dan mengalahkan iblis itu', '1', '2021-08-31 23:45:11'),
(313, 'Fumetsu no Anata e', 'To Your Eternity', 'https://cdn.myanimelist.net/images/anime/1134/111757.jpg', 'Brains Base', 'Adventure,Supernatural,Drama,Shounen', '2021-04-12', '2021', '2021spring', 'anitoki,', '25 min', 'completed', '', '', 'tv', 'NHK,NHKEnterprises', '20', 'Itu makhluk abadi misterius dikirim ke Bumi tanpa emosi atau identitas Namun ia mampu mengambil bentuk dari orang orang di sekitar yang memiliki dorongan kuat br br Pada awalnya Ini adalah sebuah bola Kemudian meniru bentuk batu Saat suhu turun dan salju turun di atas lumut lumut mewarisi Ketika seekor serigala yang terluka dan sendirian datang tertatih tatih dan berbaring untuk mati Itu mengambil bentuk binatang Akhirnya ia memperoleh kesadaran dan mulai melintasi tundra kosong sampai ia bertemu dengan seorang anak laki laki br br Anak laki laki itu tinggal sendirian di sebuah kota hantu yang telah lama ditinggalkan orang dewasa untuk mencari surga yang dikatakan berada jauh di luar lautan tundra putih yang tak ada habisnya Namun upaya mereka sia sia dan sekarang bocah itu berada dalam kondisi kritis br Mendapatkan bentuk anak laki laki Ini memulai perjalanan yang tidak pernah berakhir untuk mencari pengalaman tempat dan orang baru br br Premis seperti yang terungkap dalam urutan pembukaan narasi berkisar pada entitas yang dapat mengambil bentuk hal hal lain yang dilihatnya awalnya batu kemudian serigala Idenya meresahkan dan cara pelaksanaannya juga meresahkan Kami melihat hal ini belajar saat berinteraksi dengan anak yang tidak menaruh curiga dan keseluruhan situasinya sangat mengerikan Saya berada di tepi kursi saya selama seluruh episode br br Apa yang benar benar membuat ini melampaui ekspektasi bukanlah premis yang menarik tetapi struktur episodenya Dengan premis yang begitu menarik akan mudah bagi episode pertama untuk sekadar menetapkan premis memperkenalkan beberapa karakter mengatur episode berikutnya lalu memutar kreditnya Format ini baik baik saja dan itulah yang saya harapkan tetapi yang saya dapatkan jauh lebih baik Episode pertama adalah keseluruhan cerita emosional dan mengasyikkan Ini memiliki awal tengah dan akhir dan sementara itu mencapai kesimpulan episode internal yang memuaskan masih berhasil mengatur episode berikutnya Jika seluruh seri memiliki episode seperti ini itu akan mudah 10 Jika tidak maka setidaknya akan bisa pesta br br Harapan terbesar saya untuk pertunjukan selain kualitas yang konsisten adalah bahwa itu bersandar pada nada yang menakutkan di episode selanjutnya Premisnya begitu meresahkan sehingga akan memalukan jika sisa serialnya tidak terus mengembangkan suasana yang menyeramkan sambil tetap menghadirkan momen momen yang menyayat hati seperti di episode pertama Jika Anda bertanya tanya apakah Anda harus mencoba ini Anda harus melakukannya Saya berharap untuk menikmati sisa pertunjukan ini', '1', '2021-08-31 23:54:07'),
(314, 'Uramichi Oniisan', 'Life Lessons with Uramichi-Oniisan', 'https://cdn.myanimelist.net/images/anime/1126/115635.jpg', 'Studio Blanc', 'Comedy,SliceofLife', '2021-07-06', '2021', '2021summer', 'huntersekai,,,', '23 min', 'completed', '', '', 'tv', 'KingRecords,Bitgrooovepromotion,Fun', '13', 'Halo anak laki laki dan perempuan Apakah kamu menyukai pria yang memiliki lebih dari satu sisi br Omota Uramichi 31 tahun adalah pelatih senam di program TV pendidikan anak anak Bersama Mama Dia mungkin manis di luar tapi semua anak laki laki dan perempuan pasti takut setiap kali mereka melihat sekilas kegelapan dewasa yang merupakan hasil dari ketidakstabilan emosi Uramichi sensei Ini adalah pidato tragis untuk semua anak laki laki dan perempuan yang sekarang sudah dewasa', '1', '2021-09-28 10:24:39'),
(315, 'Seirei Gensouki', 'Spirit Chronicles', 'https://cdn.myanimelist.net/images/anime/1453/116276.jpg', 'TMS Entertainment', 'Action,Adventure,Drama,Fantasy,Harem,Romance', '2021-07-06', '2021', '2021summer', 'samehadaku,,,', '23 min', 'ongoing', '', '', 'tv', 'NipponColumbia,KanonSound,TMSMusic', '12', 'Amakawa Haruto adalah seorang pemuda yang meninggal sebelum bersatu kembali dengan teman masa kecilnya yang menghilang lima tahun lalu Rio adalah seorang anak laki laki yang tinggal di daerah kumuh yang ingin membalas dendam atas ibunya yang dibunuh di depannya ketika dia berusia lima tahun br br Bumi dan dunia lain Dua orang dengan latar belakang dan nilai yang sangat berbeda Untuk beberapa alasan ingatan dan kepribadian Haruto yang seharusnya mati dibangkitkan di tubuh Rio Saat keduanya bingung tentang ingatan dan kepribadian mereka yang menyatu Rio memutuskan untuk hidup di dunia baru ini br br Seiring dengan ingatan Haruto Rio membangkitkan kekuatan khusus yang tidak diketahui dan tampaknya jika dia menggunakannya dengan baik dia bisa menjalani kehidupan yang lebih baik Namun sebelum itu Rio menghadapi penculikan yang ternyata adalah seorang putri Kerajaan Bertram tempat dia tinggal br br Setelah menyelamatkan sang putri Rio diberikan beasiswa di Royal Academy sebuah sekolah untuk orang kaya dan berkuasa Menjadi yatim piatu yang miskin di sekolah bangsawan ternyata menjadi tempat yang sangat menjijikkan', '1', '2021-09-21 21:27:42'),
(316, 'Deatte 5-byou de Battle', 'Battle Game in 5 Seconds', 'https://cdn.myanimelist.net/images/anime/1145/115565.jpg', 'SynergySP', 'Action,Game,SuperPower,Supernatural', '2021-07-13', '2021', '2021summer', ',,', '23 min', 'ongoing', 'ongoing', '', 'tv', 'VegaEntertainment,Shogakukan-Shueis', '', 'Itu hanya pagi yang biasa br br Akira Shiroyanagi seorang siswa sekolah menengah yang menyukai game dan Konpeito permen Jepang tiba tiba diseret ke medan perang oleh seorang gadis misterius yang menyebut dirinya Mion Para peserta diberitahu bahwa mereka dihapus dari daftar keluarga terlibat dalam eksperimen dan memperoleh kekuatan tertentu br br Akira bertekad untuk memenangkan permainan dengan kekuatan barunya dan menghancurkan organisasi Berbekal kekuatan yang tidak diharapkan siapa pun dan keterampilan otaknya periode baru pertempuran intelijen dimulai', '1', '2021-09-21 20:46:11'),
