(321, 'Obey Me', '', 'https://cdn.myanimelist.net/images/anime/1416/113986.jpg', 'Colored Pencil Animation', 'Comedy,Demons,Fantasy', '2021-07-16', '2021', '2021spring', ',,', '5 min', 'ongoing', 'kamis', '', 'tv', 'Sotsu,Bouncy,ToeiAgency', '', 'Lucifer Satan dan lima pangeran neraka lainnya adalah siswa di Royal Academy of Diavolo tempat mereka berlatih untuk menguasai Dunia Iblis Dari mengikuti manusia hingga jatuh cinta keunikan masing masing membuat mereka berada dalam situasi yang menarik setiap hari Akankah kejenakaan mereka membuat mereka diusir atau akankah salah satu dari saudara saudara yang terkenal ini keluar sebagai yang teratas', '1', '2021-09-18 17:13:07'),
(322, 'Maiko San Chi No Makanai San', 'Kiyo in Kyoto: From the Maiko House', 'https://cdn.myanimelist.net/images/anime/1355/111545.jpg', 'J.C.Staff', 'SliceofLife,Comedy,Shounen', '2021-02-25', '2021', '2021winter', '', '25 min', 'ongoing', 'kamis', '', 'tv', 'NHK,NHKEnterprises', '12', 'Kiyo dan Sumire datang ke Kyoto dari Prefektur Aomori bermimpi menjadi maiko Tapi setelah kejadian yang tak terduga Kiyo mulai bekerja sebagai koki live in di Maiko House Kisah mereka terungkap di Kagai distrik Geiko dan maiko di Kyoto bersama maiko teman serumah mereka Kiyo memberi makan mereka setiap hari dengan makanan rumahannya dan Sumire berjuang menuju masa depannya yang menjanjikan sebagai maiko sekali dalam seabad br br Masuki Kagai yang glamor hangatkan hati Anda dengan anekdot di balik layar dan episode dapur Kiyo Nantikan kisah menyentuh tentang 2 teman masa kecil yang saling mengangkat saat mereka tumbuh bersama', '1', '2021-09-02 23:12:30'),
(323, 'Love Live! Superstar!!', '', 'https://cdn.myanimelist.net/images/anime/1758/115692.jpg', 'Sunrise', 'Music,SliceofLife,School', '2021-07-11', '2021', '2021summer', 'huntersekai,,,', '23 min', 'ongoing', 'ongoing', '', 'tv', 'Funimation,Kadokawa,BandaiNamcoArts', '12', 'Setiap orang memiliki mimpi yang ingin mereka capai begitu juga Kanon Shibuya yang berbakat dalam musik Namun karena demam panggungnya Kanon gagal masuk ke program musik SMA Putri Yuigaoka dan malah berakhir di kurikulum umum Meskipun Kanon membuat keputusan sadar untuk berhenti dari musik sama sekali teman sekelasnya Tang Keke menyalakan kembali hasrat Kanon untuk musik dengan miliknya sendiri hasrat untuk idola sekolah Meskipun Keke dan Kanon mencoba membentuk grup idola sekolah upaya mereka mendapat penolakan keras dari Ren Hazuki putri direktur sekolah Meski begitu gadis gadis itu segera mengunjungi direktur yang mengizinkan mereka untuk mendirikan klub idola sekolah mereka dengan satu syarat mereka harus memenangkan tempat pertama di Festival Idola Sekolah Yoyogi Ketangguhan para calon idola ini diuji saat mereka menghadapi tantangan yang menghadang Sepanjang perjalanan mereka para gadis mendapatkan teman baru dan bertemu anggota baru yang bergabung dengan mereka untuk menjadi idola mempesona yang hanya bisa dibayangkan orang lain ', '1', '2021-09-27 23:16:13'),
