(326, 'Aria the Crepuscolo', '', 'https://cdn.myanimelist.net/images/anime/1934/111002.jpg', 'J.C.Staff', 'Sci-Fi,SliceofLife,Fantasy,Shounen', '2021-03-05', '2021', '2021winter', '', '1 hr', 'completed', '', '', 'movie', 'Shochiku', '1', 'Musim gugur dan kota Neo Venezia diselimuti daun daun berguguran Ada sesuatu yang mengganggu Anya yang bekerja di Orange Planet Rekan seniornya Alice dan Athena tidak bertemu karena jadwal mereka yang padat yang membuat Athena merasa sedih Tapi untuk beberapa alasan Alice sepertinya menghindarinya sama sekali Dengan bantuan teman temannya Ai dan Azusa Anya mencoba menemukan cara pasti bagi Alice dan Athena untuk berkumpul Tetapi selama ini Anya mengetahui situasi yang hanya bisa dilihatnya karena di mana dia berdiri ', '1', '2021-09-07 20:49:20'),
