(330, 'Wo Qiku Liao Bai Wan Xiulian Zhe', 'I Upset Millions of Cultivators, Aku Membuat Kesal Jutaan Kultivator, annoying system', 'https://i1.wp.com/anichin.my.id/wp-content/uploads/2021/08/I-Irritated-A-Million-Cultivators.jpg', 'Soyep', 'Action,Adventure,Fantasy,Donghua,cgi', '2021-08-19', '2021', '2021summer', 'anichin,kazefuri,,,', '10 menit', 'ongoing', 'kamis', '', 'ona', 'TencentPenguinPictures', '60', 'Untungnya ia menjadi tuan rumah sistem dan melakukan perjalanan ke dunia lain Di dunia yang berbeda ini penuh dengan kultivator Jiangbei telah berubah dari seorang sampah di kota kecil menjadi anak jenius di mata semua orang Mengandalkan sistem Jiangbei telah memulai jalan peningkatan dan menjadi lebih kuat hanya dengan memainkan harta dan membuat orang kesal Setelah serangkaian kekacauan dan pertempuran puisi Jiangbei secara bertahap mengembangkan perasaan untuk kerabatnya di sini Jiangbei saudara jeniusnya Jiangnan dan putri Wu Wang Hou Yanlan bergandengan tangan untuk melawan kekuatan misterius dan roh jahat yang tak ada habisnya Seiring berkembangnya cerita pengalaman hidup Jiangbei yang misterius secara bertahap terungkap dan keluhan dan kebencian dari generasi sebelumnya berlanjut ke Jiangbei Tujuh belas tahun yang lalu Jiang Wanguan diburu oleh keluarga musuh Dalam keputusasaan ia membawa Jiangbei dan Jiangnan yang masih bayi melintasi perairan tak berujung dari benua tengah ke benua utara di mana aura langka dan keberadaannya masih misteri hingga hari ini Dengan kedatangan kekuatan misterius segel lama akan rusak menghancurkan kehidupan yang tenang Jiangbei muncul dari pertempuran demi pertempuran melihat asal usul kekuatan misterius dan memecahkan krisis Pertempuran yang mengguncang bumi memutuskan hubungan tak tertandingi antara dunia dan bumi Para jenius dari benua tengah datang ke benua utara dengan bantuan formasi teleportasi Untuk melindungi perdamaian benua Jiangbei menghadapi jenius dari benua tengah menunjukkan kekuatan mereka memaksa mereka satu per satu Setelah teleportasi hilang ruang dan waktu diblokir kembali dan dunia terisolasi Setelah mengetahui bahwa ibunya tidak mati Jiangbei dipenjarak oleh Sekte Sepuluh Ribu Iblis dari Benua Starfall selama hampir dua dekade bertekad untuk menyeberangi laut tak berujung yang misterius dan luas ke benua tengah dunia ini dan menginjakkan kaki di jalan untuk menyelamatkan ibunya Sebuah perjalanan yang mulia', '1', '2021-09-30 11:22:41'),
