(339, 'Mo Dao Zu Shi: Xian Yun Pian', 'Grandmaster of Demonic Cultivation 2, The Founder of Diabolism 2, Mo Dao Zu Shi 2nd Season', 'https://cdn.myanimelist.net/images/anime/1404/106707.jpg', 'B.CMAY PICTURES', 'Action,Mystery,Historical,Supernatural,Donghua', '2019-08-03', '2019', '2019summer', ',,', '24 min', 'completed', '', '', 'ona', 'TencentPenguinPictures', '8', 'Melanjutkan penyamarannya sebagai orang gila gila dari Klan Lanling Jin Wei Wuxian tinggal di Cloud Recesses sementara mantan teman sekelas kultivasinya Lan Wangji mencari jawaban tentang lengan terputus iblis yang mereka miliki dalam tahanan Dengan energi gelap yang luar biasa memancar dari lengan keduanya dipaksa untuk bekerja sama agar tetap terkendali Namun lengan iblis bukanlah satu satunya kekuatan gelap yang mengintai di wilayah tersebut dan ketika ketegangan spiritual meningkat di pegunungan Klan Gusu Lan terserah pada mereka berdua untuk mencoba dan memulihkan tatanan alam Kisah kejatuhan Wei Wuxian dari anugerah terus berlanjut saat lebih banyak cahaya dicurahkan saat dia turun ke jalur kultivasi iblis Lengan iblis itu semakin membuat roh nakalnya semakin tegang Ini adalah waktu baginya untuk membuktikan bahwa dia benar benar telah membebaskan diri dari jalan terlarang dan bukan penyihir maniak seperti yang diingat semua orang ', '1', '2021-09-15 18:01:50'),
(340, 'Yoru no Kuni', 'Night World, Night Country', 'https://cdn.myanimelist.net/images/anime/1674/114425.jpg', 'Studio Daisy', 'Fantasy', '2021-04-16', '2021', '2021spring', '', '7 min', 'completed', '', '', 'ona', ' ', '3', 'Penyanyi Aimer dan proyek anime pendek asli Sutradara Ryo timo Night World Yoru no Kuni yang merupakan serial animasi pendamping untuk album Aimer Walpurgis Episode pertama bertema lagu Trill dari album Selamat datang di Dunia Malam Kecemasan hal menakutkan dan sedih yang membuat Anda berpikir dalam kegelapan Semakin Anda tidak bisa tidur semakin Anda merasa menderita Baiklah Anda tidak bisa tidur karena Anda mencoba menemukan sesuatu Malam adalah tempat yang tepat untuk menemukannya Ayo istirahat malam ini Ini tempat yang gelap tapi tolong jelajahi dengan bebas Soalnya malam terus berjalan', '1', '2021-09-15 21:15:46'),
