(343, 'Dragon Ball', 'Dragonball, DB', 'https://cdn.myanimelist.net/images/anime/1887/92364.jpg', 'Toei Animation', 'Adventure,Comedy,Fantasy,MartialArts,SuperPower,Shounen', '1986-02-26', '1986', '1986winter', ',,', '24 min', 'completed', '', '', 'tv', 'FujiTV,HarmonyGold,Funimation', '153', 'Gokuu Son adalah seorang anak laki laki yang tinggal di hutan sendirian sampai seorang gadis bernama Bulma bertemu dengannya dalam pencariannya untuk satu set benda ajaib yang disebut Bola Naga Karena artefak dikatakan memberikan satu keinginan kepada siapa pun yang mengumpulkan ketujuhnya Bulma berharap untuk mengumpulkannya dan berharap untuk pacar yang sempurna Gokuu kebetulan memiliki bola naga tapi sayangnya untuk Bulma dia menolak untuk berpisah dengannya jadi dia membuat kesepakatan dia bisa ikut dalam perjalanannya jika dia membiarkannya meminjam kekuatan bola naga Dengan itu keduanya memulai perjalanan seumur hidup br Mereka tidak melakukan perjalanan sendirian Dalam perjalanan mereka bertemu dengan Muten Roshi tua dan calon murid Kuririn dengan siapa Gokuu berlatih untuk menjadi seniman bela diri yang lebih kuat untuk Turnamen Seni Bela Diri Dunia yang akan datang Namun tidak semua kesenangan dan permainan kemampuan untuk mewujudkan keinginan apa pun adalah kekuatan yang kuat dan ada orang lain yang melakukan jauh lebih buruk daripada hanya berharap untuk pacar Untuk menghentikan mereka yang mencoba menyalahgunakan kekuatan legendaris mereka berlatih untuk menjadi petarung yang lebih kuat menggunakan kekuatan baru mereka untuk membantu orang orang di sekitar mereka di sepanjang jalan', '4', '2021-09-26 01:44:39'),
(344, 'Bai She 2: Qing She Jie Qi', 'White Snake 2: The Tribulation of the Green Snake', 'https://cdn.myanimelist.net/images/anime/1024/116463.jpg', 'Light Chaser Animation Studios', 'Action,Adventure,Fantasy,Donghua,cgi', '2021-07-23', '2021', '2021summer', 'kazefuri,,,', 'Alibaba Pictures,bili', 'completed', '', '', 'movie', 'AlibabaPictures,bilibili,', '1', 'Pada tahun tahun terakhir Dinasti Song Xiao Bai dipaksa oleh Fa Hai di bawah Pagoda Leifeng untuk menyelamatkan Xu Xianshui di atas Gunung Jinshan Xiao Qing secara tidak sengaja dipukuli oleh Fa Hai ke dalam ilusi Kota Shura yang aneh Dalam beberapa krisis Xiao Qing diselamatkan oleh seorang remaja bertopeng misterius Xiao Qing mengambil kesemaptan untuk menyelamatkan obsesi Xiao Bai dan mengalami malapetaka Bersama dengan remaja bertopeng dia mencari cara untuk pergi dari Kota Shura melalui Jembatan Ruguo', '1', '2021-09-18 11:47:47'),
(345, 'Bai She: Yuan Qi', 'White Snake', 'https://cdn.myanimelist.net/images/anime/1559/103214.jpg', 'Light Chaser Animation Studios', 'Action,Adventure,Drama,Fantasy,Romance,Demons,Historical,MartialArts,cgi,Donghua', '2019-01-11', '2019', '2019winter', '', '1 hr. 38 min.', 'completed', '', '', 'movie', 'GKIDS', '1', 'Xiao Bai iblis ular putih dikirim dalam misi untuk membunuh penasihat Tao Kaisar yang telah membunuh ular secara massal untuk mencapai keabadian dan menjilat Kaisar Xiao Bai bagaimanapun diserang oleh antek penasihat sebelum dia bisa menghubunginya dan kemudian dikalahkan Untungnya jepit rambut iblis yang diberikan oleh Ibu Ular mampu menyelamatkan hidupnya dengan mengorbankan ingatannya Xiao Bai terbangun di desa Penangkap Ular tidak menyadari bahwa dia sebenarnya adalah iblis atau bahwa dia dikelilingi oleh musuh bebuyutannya Dia bertemu Xu Xuan pria yang menyelamatkannya dan terpesona olehnya Keduanya memulai perjalanan untuk menemukan siapa Xiao Bai dan mempelajari rahasia jepit rambut iblisnya Pasangan ini dikejar oleh Xiao Qing saudara perempuan Xiao Bai yang telah bersumpah kepada Ibu Ular untuk mengambil Xiao Bai dalam waktu tiga hari atau mati saat mencoba Saat penganut Tao iblis dan manusia bertabrakan kisah asmara terlarang terungkap', '1', '2021-09-18 11:47:35'),
(346, 'Getsuyoubi no Tawawa 2', 'Tawawa on Monday Two', 'https://cdn.myanimelist.net/images/anime/1370/117813.jpg', 'Yokohama Animation Lab', 'SliceofLife,Ecchi', '2021-09-20', '2021', '2021summer', ',,', '6 min', 'ongoing', 'ongoing', '', 'ona', 'NBCUniversalEntertainmentJapan', '12', 'Anime ini mengikuti seorang pegawai yang memiliki kesempatan bertemu dengan seorang gadis bernama Ai di kereta Mereka mulai bertemu setiap hari Senin di kereta dengan pria yang menjadi pengawalnya di perjalanan yang ramai saat mereka mengobrol', '1', '2021-09-27 16:49:13'),
(347, 'Ganbare Douki-chan', 'Do Your Best, Douki-chan, Senpai is Mine', 'https://cdn.myanimelist.net/images/anime/1185/117548.jpg', 'AtelierPontdarc', 'Comedy,Romance,Ecchi', '2021-09-20', '2021', '2021summer', ',,', '6 min', 'ongoing', 'ongoing', '', 'ona', ' ', '12', 'Di kamar bersama dengan rekan kerjaku di hotel Meskipun aku diperingatkan untuk tidak melakukan hal bodoh mataku secara tidak sengaja akan beralih ke kakinya yang terbungkus stoking Namun tanpa sepengetahuannya Douki chan diam diam telah perasaan untuknya Saat Douki chan berjuang untuk mengakui perasaannya saingannya baik kouhai dan senpai terus bersaing untuk mendapatkan kasih sayangnya Ganbare Douki chan secara realistis menggambarkan tekstur pakaian ekspresi imut dan situasi menarik dengan banyak godaan menampilkan banyak sorotan yang memuaskan', '1', '2021-09-27 16:38:49'),
(348, 'Showtime!: Uta no Oneesan datte Shitai', '', 'https://cdn.myanimelist.net/images/anime/1585/117288.jpg', 'Studio Mausu', 'Erotica', '2021-10-04', '2021', '2021fall', '', '5 min', 'ongoing', 'hiatus', '', 'tv', 'Suiseisha', '', 'Kisah Showtime Uta no Oneesan datte Shitai dimulai ketika Shouji Fujimoto seorang janda ayah tunggal yang bercita cita menjadi penulis buku bergambar bertemu dengan Minami Takasaki seorang penyanyi idola di acara pendidikan anak anak Oneesan to Utaou Ayo Bernyanyi Bersama Penyanyi Wanita Kita di luar pekerjaan Sebagai idola televisi untuk anak anak Minami kesepian dalam kehidupan pribadinya dan tidak diperbolehkan untuk jatuh cinta Skandal apa pun benar benar dilarang Maka dimulailah kisah cinta orang dewasa dengan seorang penyanyi wanita', '1', '2021-09-22 15:55:47'),
